// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Sidebar from './components/Sidebar';
import CategoryPage from './pages/CategoryPage';
import SidebarTestPage from './pages/SidebarTestPage'; // Import the test page
import { WebGazerProvider } from './hooks/WebGazerContext'; // Use WebGazerProvider
import './App.css';

const App = () => {
  return (
    <WebGazerProvider>
      <Router>
        <div className="app-container">
          <Routes>
            <Route path="/" element={<CategoryPage id="หน้าหลัก" />} />
            <Route path="/category/:id" element={<CategoryPage />} />
            <Route path="/sidebar-test" element={<SidebarTestPage />} /> {/* Test route */}
          </Routes>
        </div>
      </Router>
    </WebGazerProvider>
  );
};

export default App;
